/* Model creation/destruction functions */

void MODEL_mkDRAM_tb::create_model(tSimStateHdl simHdl, bool master)
{
  sim_hdl = simHdl;
  init_reset_request_counters(sim_hdl);
  mkDRAM_tb_instance = new MOD_mkDRAM_tb(sim_hdl, "top", NULL);
  bk_get_or_define_clock(sim_hdl, "CLK");
  if (master)
  {
    bk_alter_clock(sim_hdl, bk_get_clock_by_name(sim_hdl, "CLK"), CLK_LOW, false, 0llu, 5llu, 5llu);
    bk_use_default_reset(sim_hdl);
  }
  bk_set_clock_event_fn(sim_hdl,
			bk_get_clock_by_name(sim_hdl, "CLK"),
			schedule_posedge_CLK,
			NULL,
			(tEdgeDirection)(POSEDGE));
  (mkDRAM_tb_instance->INST_dut_mem_cells_mem_bank.set_clk_1)("CLK");
  (mkDRAM_tb_instance->INST_dut_mem_cells_mem_bank.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_dut_instQ.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_dut_commandQ.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_dut_addrQ.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_dut_inputDataQ.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_dut_outputDataBuff.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_start_wire.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_start_reg_2.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_abort.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_state_set_pw.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_state_overlap_pw.set_clk_0)("CLK");
  (mkDRAM_tb_instance->INST_state_fired_1.set_clk_0)("CLK");
  (mkDRAM_tb_instance->set_clk_0)("CLK");
}
void MODEL_mkDRAM_tb::destroy_model()
{
  delete mkDRAM_tb_instance;
  mkDRAM_tb_instance = NULL;
}
void MODEL_mkDRAM_tb::reset_model(bool asserted)
{
  (mkDRAM_tb_instance->reset_RST_N)(asserted ? (tUInt8)0u : (tUInt8)1u);
}
void * MODEL_mkDRAM_tb::get_instance()
{
  return mkDRAM_tb_instance;
}

/* Fill in version numbers */
void MODEL_mkDRAM_tb::get_version(unsigned int *year,
				  unsigned int *month,
				  char const **annotation,
				  char const **build)
{
  *year = 0u;
  *month = 0u;
  *annotation = NULL;
  *build = "e4c11968";
}

/* Get the model creation time */
time_t MODEL_mkDRAM_tb::get_creation_time()
{
  
  /* Mon Aug 19 05:18:52 UTC 2024 */
  return 1724044732llu;
}

/* State dumping function */
void MODEL_mkDRAM_tb::dump_state()
{
  (mkDRAM_tb_instance->dump_state)(0u);
}

/* VCD dumping functions */
MOD_mkDRAM_tb & mkDRAM_tb_backing(tSimStateHdl simHdl)
{
  static MOD_mkDRAM_tb *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkDRAM_tb(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
void MODEL_mkDRAM_tb::dump_VCD_defs()
{
  (mkDRAM_tb_instance->dump_VCD_defs)(vcd_depth(sim_hdl));
}
void MODEL_mkDRAM_tb::dump_VCD(tVCDDumpType dt)
{
  (mkDRAM_tb_instance->dump_VCD)(dt, vcd_depth(sim_hdl), mkDRAM_tb_backing(sim_hdl));
}
